description:
Unbelievable Flying Objects

Technology Documentary hosted by Brad Davis, published by PBS in 2007 - English narration


Information
------------------------------

Unbelievable Flying Objects
A hilarious countdown of the black sheep of aviation, aircraft that have embarrassed their builders, enraged the owners and terrified their pilots. These are stories of aircraft that should have never been built, including highly imaginative concepts to &quot;fly&quot; tanks and jeeps directly onto the battlefield, a real flying saucer and starkly bizarre efforts to design and build a submarine that flies. We come to understand why these ideas were doomed from the start...

